using System;
using System.IO;
using System.Web.UI;

namespace html_example
{
    class Program
    {
        static string htmlPage()
        {

            // Initialize StringWriter instance.
            StringWriter stringWriter = new StringWriter();

            // Put HtmlTextWriter in using block because it needs to call Dispose.
            HtmlTextWriter writer = new HtmlTextWriter(stringWriter);


            writer.WriteFullBeginTag("!DOCTYPE html"); // Start doc html
            writer.RenderBeginTag(HtmlTextWriterTag.Html); // Begin html

            WriteHead(writer); //calling function that creating the head with include the css styling 

            writer.RenderBeginTag(HtmlTextWriterTag.Body); // Begin #body

            WriteH2("Images in a table", writer); //calling function that created the header with the required 

            WriteTableImages(writer);


            // Return the result.
            return stringWriter.ToString();
        }
        private static void WriteH2(string content, HtmlTextWriter writer)
        {
            writer.RenderBeginTag(HtmlTextWriterTag.H2);
            writer.Write(content);
            writer.RenderEndTag();
        }

        private static void WriteTableImages(HtmlTextWriter writer)
        {
            string image1string = "";
            string image2string = "";
            string image3string = "";


            string[] base64images = { image1string, image2string, image3string };
            writer.RenderBeginTag(HtmlTextWriterTag.Div);
            writer.RenderBeginTag(HtmlTextWriterTag.Table); //Begin table
            writer.RenderBeginTag(HtmlTextWriterTag.Tbody);

            writer.RenderBeginTag(HtmlTextWriterTag.Th); // Begin table header 1
            writer.Write("Image Name");
            writer.RenderEndTag(); // End table header 1
            writer.RenderBeginTag(HtmlTextWriterTag.Th); //Begin table header 2
            writer.Write("Photo");
            writer.RenderEndTag(); // End table header 2
            writer.RenderEndTag(); // End header row

            int imageCount = 1;
            foreach (string imageString in base64images)
            {
                writer.RenderBeginTag(HtmlTextWriterTag.Tr); //Begin the table row
                writer.RenderBeginTag(HtmlTextWriterTag.Td); //Begin table data cell
                writer.Write($"Image #{imageCount}"); //Add string attribute
                writer.RenderEndTag(); //End table data cell
                writer.RenderBeginTag(HtmlTextWriterTag.Td); //Begin table data cell
                writer.AddAttribute(HtmlTextWriterAttribute.Src, $"data:image/jpg;base64,{imageString}"); //Add image attribute
                writer.RenderBeginTag(HtmlTextWriterTag.Img); //Begin image tag with the  image attribute
                writer.RenderEndTag(); //End image tag
                writer.RenderEndTag(); //End table data cell
                writer.RenderEndTag(); //End table row
                imageCount++;
            }

            writer.RenderEndTag(); // End table
            writer.RenderEndTag(); // End div
            writer.RenderEndTag(); // End html
        }

        private static void WriteHead(HtmlTextWriter writer)

        {
            writer.RenderBeginTag(HtmlTextWriterTag.Head); //begin head

            string styleSheetContent = File.ReadAllText("styles.css");
            writer.Write($@"
        <style type = 'text/css'> 
        {styleSheetContent}
        </style>
        ");
            writer.RenderEndTag(); // End head
        }
        static void Main()
        {
            // Demonstrate HtmlTextWriter.
            Console.WriteLine(htmlPage());
        }
    }
}
